import TrackMap from "../components/TrackMap";
import {k} from '../utils/projectdata';
export default function TrackView(props:{id:number|undefined}){
return<>
{props.id!==undefined&&<TrackMap track={{
     startX: 40.7128, // Latitude of start point
     startY: -74.0060, // Longitude of start point
     endX: 34.0522, // Latitude of end point
     endY: -118.2437, // Longitude of end point
     stops: [
       { x: 41.8781, y: -87.6298 }, // Latitude and longitude of stop 1
       { x: 39.9526, y: -75.1652 }, // Latitude and longitude of stop 2
       // Add more stops as needed
     ],
}}
apiKey={k}
/>}
</>
}
